import Vue from 'vue'
import './plugins/vuetify'
import App from './App.vue'
//import router from './router'
import axios from 'axios'
import '@yeliulee/vue-mdi-svg/src/styles.css'
import MdiSvg from '@yeliulee/vue-mdi-svg/v2'
Vue.config.productionTip = false

Vue.prototype.$ajax = axios
Vue.use(MdiSvg)

//import Vue from 'vue'
import Router from 'vue-router'
import Home from './components/RotatorMain.vue'
import Light from './components/RotatorLight.vue'

import RotatorDataset from './components/RotatorDataset.vue'
Vue.use(Router)


const router = new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/data',
      name: 'data',
      component: RotatorDataset
    },
    {
      path: '/light',
      name: 'light',
      component: Light
    }
  ]
})

const app=new Vue({
  router,
  render: h => h(App)
}).$mount('#app')

router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.reuse === false)) {
    app.key = to.path
  } else {
    app.key = null
  }
  next()
})
